from django.db import modelsfrom apps.account.models import Accountclass TariffModel(models.Model):    name = models.CharField(max_length=255)    created_by = models.ForeignKey(Account, related_name="tariff", on_delete=models.SET_NULL, null=True)    created_at = models.DateTimeField(auto_now_add=True)    modified_at = models.DateTimeField(auto_now=True)    modified_by = models.ForeignKey(Account, related_name="modf_tariff", on_delete=models.SET_NULL, null=True)    def __str__(self):        return f"{self.name}"